import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import CompetitionList from './components/CompetitionList.js';
import CompetitionForm from './components/CompetitionForm.js';
import EventList from './components/EventList.js';
import Leaderboard from './components/LeaderBoard.js';

const App = () => {
    return (
        <Router>
            <div>
                <h1>Competition Tracker</h1>
                <Switch>
                    <Route path="/" exact component={CompetitionList} />
                    <Route path="/add-competition" component={CompetitionForm} />
                    <Route path="/competition/:id" component={EventList} />
                    <Route path="/leaderboard/:id" component={Leaderboard} />
                </Switch>
            </div>
        </Router>
    );
};

export default App;
